import {useState} from 'react'
import Story from './Story'
import Store from './Store'


interface Props {
    setPage: React.Dispatch<React.SetStateAction<boolean>>
    page: boolean
    health: number
    setHealth:React.Dispatch<React.SetStateAction<number>>
    attack: number
    setAttack :React.Dispatch<React.SetStateAction<number>>
    accuracy: number
    setAccuracy: React.Dispatch<React.SetStateAction<number>>
}


const Middle: React.FC<Props> = ({ setPage, page,health,setAccuracy,setAttack,setHealth,attack,accuracy }) => {

return(
    <div className="Middle">
      {/* <h1>Middle</h1> */}
        { page ? <Story setPage={setPage}/> : <Store setPage={setPage}/>}
        <h2 className='stat-h'>Health: {health}</h2>
        <h2 className='stat-a'>Attack: {attack}</h2>
        <h2 className='stat-a'>Attack: {accuracy}</h2>
    </div>
)
}
export default Middle
